DROP TABLE IF EXISTS "public"."word";

CREATE TABLE "public"."word" (
    "id" uuid NOT NULL,
    "lemma_raw" text NOT NULL,
    "lemma_rich" text NOT NULL,
    "translation" text NOT NULL,
    "lasla_frequency" int4,
    "known" bool NOT NULL DEFAULT false,
    "created_at" timestamptz NOT NULL DEFAULT now(),
    "modified_at" timestamptz NOT NULL DEFAULT now(),
    "deleted_at" timestamptz,
    PRIMARY KEY ("id")
);

CREATE UNIQUE INDEX word_lemma_raw_lemma_rich_key ON public.word USING btree (lemma_raw, lemma_rich);

